INSERT INTO `brakingfluids` VALUES (120,'Comma DOT4 1л',19,1100,2,260,155,1,'Fluid1.jpg','Универсальная синтетическая тормозная жидкость ДОТ4\r\nПрименима для всех гидравлических тормозных систем и систем сцепления, где требуется спецификация DOT3, DOT4, J1703.\r\nИдеальна для тормозных систем c ABS. Смешивается со всеми жидкостями DOT3, DOT4, SAE 1703.\r\n\r\nЗамена тормозной жидкости производится согласно рекомендациям автопроизводителей. Следить за чистотой жидкости, не допускать попадания воды, масла, грязи и пр. Гигроскопична – требует своевременной замены. Повреждает лакокрасочное покрытие.',1350,2.3,'FMVSS 116 DOT 4;\r\nISO 4925;\r\nSAE J-1704. ',0),(121,'Bosch DOT4 500мл',20,5200,2,300,10000,0.52,'Fluid2.jpg','Длительный срок службы и хранения:\r\n- жестяная упаковка предотвращающая гигроскопичность;\r\n- запатентованная природоохранная система переработки упаковки. ',0,0,'',0),(122,'TRW Brake Fluid DOT5.1 1л',21,160000,13,120,100,2,'Fluid3.jpg','1111\r\nАвтомобили премиум класса, включая автомобили, оснащенные ABS. Состав жидкости обеспечивает максимальный уровень безопасности. Благодаря улучшенным вязкостным характеристикам при температуре -40°C, жидкость безопасна при использовании в самом холодном климате. \r\n',0,0,'',0),(123,'Fuchs Maintain DOT 4 1л',22,185000,2,0,0,1,'Fluid4.jpg','MAINTAIN DOT 4 – это высокоэффективная тормозная жидкость для гидравлических тормозных системы легкового и коммерческого транспорта, а также для гидравлических приводов сцепления, если рекомендуется к применению тормозная жидкость.',0,0,'FMVSS NR. 116; DOT 3/DOT 4; ISO 4925 CLASS 3/4; SAE J 1703/J 1704; FORD M6C62-A; FORD M6C9103-A; NH 800 A; OPEL 19 42 421 ',0),(124,'Fuchs Maintain DOT 5.1 1л',22,185000,13,270,0,1,'Fluid5.jpg','MAINTAIN DOT 5.1 это высокооэффективная тормозная жидкость для гидравлических тормозных систем легкового и коммерческого транспорта, а также для гидравлических проводов сцепления. ',900,0,'FMVSS NR. 116 DOT 5.1; ISO 4925 CLASS 3/4/5.1; SAE J 1703/J 1704 ',3),(125,'Elf Frelub 650 DOT4 1л Elf Frelub 650 DOT4 1л',23,160000,2,260,180,1,'Fluid6.jpg','Не смешивать с минеральными гидравлическими жидкостями и не применять в гидропневматических подвесках и тормозах автомобилей типа Citroen. На синтетической основе. Обладает стабильностью эксплуатационных характеристик при экстремальных температурах, противопенной активностью и стойкостью к образованию отложений и смол. Предотвращает образование коррозии. ',0,300,'SAE J 1704; FMVSS 116 (DOT 4); DOT 4; DOT 5. ',0),(126,'Ford Super DOT 4 1л',24,222,2,0,0,1,'Fluid7.jpg','Рекомендуемая замена при ТО.(test)',0,0,'FMVSS 116;\r\nSAE J 1703\';\r\nSAE J 1704. ',0),(127,'Тосол-Синтез FELIX DOT4 0.91л',25,98150,2,250,155,0.91,'Fluid8.jpg','Стандартная тормозная жидкость класса DOT4. \r\nХороша для приянтия внутрь',1650,0,'',0),(128,'Castrol Brake Fluid DOT 4 0.5л',26,126000,2,0,0,0.5,'Fluid9.jpg','Предназначено для применения во всех тормозных системах, особенно подверженных высокой нагрузке.\r\n- Тормозная жидкость с высокой температурой кипения, композиция которой включает в себя смесь сложных эфиров полиалкиленгликоля, сложного эфира бора, высокоэффективных присадок и ингибиторов.\r\n- Отличная устойчивость к экстремальным температурам.\r\n- Надежная защита тормозной\r\nсистемы от коррозии и образования паровых пробок. ',0,0,'SAE J1703;\r\nFMVSS 116 DOT 4. ',0),(129,'BP Brake Fluid DOT 0,5л',27,12.34,2,27000,170,0.5,'Fluid10.jpg','Синтетическая жидкость Brake Fluid DOT 4 не должна применяться в гидравлических системах, для которых рекомендуется использовать жидкости на минеральной основе. ',1250,2.3,'SAE J 1703; FMVSS № 116 DOT4; ISO 4925 ',5);
