INSERT INTO `motoroils` VALUES (13,'Total Quartz 9000 5W-40 5Л','Универсальное синтетическое моторное масло для бензиновых и дизельных двигателей. Рекомендуется для турбированных, мультиклапанных двигателей и двигателей с прямым впрыском.',5,1,4.8,516000,'Oil1.jpg','ACEA A3/B4;\nAPI: SN/CF;\nPEUGEOT CITROEN: B71 2296;\nVOLKSWAGEN: 502.00/505.00;\nBMW: LL-01;\nMB: 229.3;\nPORSCHE A40.',5,'5W-40',31),(14,'GM Longlife Dexos 2 5W-30 5л','GM Dexos 2 Longlife 5W-30 относится к маслам с длительным сроком эксплуатации. Обладает отличной вязкостной стабильностью при высоких рабочих температурах. Содержит двигатель в абсолютной чистоте, и предохраняет от осадков, окислов и износа, даже при высоких температурах. Низкая вязкость делает холодные старты легкими и неощутимыми. Увеличивает работоспособность каталитического нейтрализатора, чем уменьшает нежелательные выбросы в атмосферу.',5,1,4,390000,'Oil2.jpg','API SM/CF;\nACEA A3/B4, C3;\nGM-LL-A-025;\nGM-LL-B-025; \nBMW Longlife-04; \nVW 502.00,505.00,505.01;\nMB 229.51.',5,'5W-30',32),(15,'Ford Formula F 5W-30 5л','Ford Formula F 5W-30 - это специальное топливосберегающее масло для современных двигателей Ford с высокими эксплуатационными характеристиками, работающих в различных условиях эксплуатации.\nРекомендовано для большинства существующих, а также для перспективных моделей Ford европейского модельного ряда.\n\nРекомендовано для бензиновых и дизельных двигателей Ford.',5,1,0,480000,'Oil3.jpg','ACEA A5/B5;\nFord: WSS-M2C913-C;\nWSS-M2C913-B, WSS-M2C913-A',5,'5W-30',33),(16,'Elf Evolution 700 STI 10W-40 5л','Изготовлено на основе полусинтетической технологии. Сохраняет технические показатели в течение всего срока службы, увеличивая интервалы между сменами масла. Оптимизировано в соответствии с требованиями новой технологии прямого впрыска в дизельных двигателях. Адаптировано для любого вида эксплуатации (город, магистраль, длительные автомобильные поездки), а также для наиболее сложных условий (высокие температуры). Детергентные свойства позволяют сохранить чистоту и уменьшить износ двигателя. Широкий диапазон вязкости способствует быстрой смазке деталей двигателя при холодном запуске.',5,5,5,380000,'Oil4.jpg','ACEA A3/B4;\nAPI SL/CF;\nVW 501.01/505.00;\nMB-Approval 229.1.',5,'10W-40',31),(17,'Motul 8100 X-cess 5W40 5л','Специально разработано для современных мощных, с большим объемом двигателей легковых автомобилей, для бензиновых и дизельных двигателей с непосредственным впрыском, оснащенных системами нейтрализации отработанных газов.',5,1,4,940000,'Oil5.jpg','ACEA A3/B4;\nAPI SN/CF;\nBMW LL-01;\nFIAT 9.55535 - H2/M2/N2;\nGM-OPEL LL-B025;\nMB-Approval 229.5/226.5;\nPORSCHE A40;\nRENAULT RN0710/RN0700;\nVW 502 00, 505 00.',5,'5W-40',34),(18,'Castrol Edge 5W-30 4л','Композиция этого продукта снижает интенсивность процесса блокировки дизельных сажевых фильтров, продлевая срок их службы. Моторное масло Castrol EDGE 5W-30 в равной степени предназначено для автомобилей как с бензиновым, так и с дизельным двигателями, где требуются спецификации VW 504 00 и 507 00. В дополнение к очищающим свойствам противоизносные присадки EDGE 5W-30 обеспечивает надёжную защиту современных двигателей с турбонагнетателем, FSI и TDI. EDGE 5W-30 одобрено к использованию в современных дизельных моторах BMW, а также в бензиновых и дизельных двигателях Mercedes, в том числе оснащённых сажевыми фильтрами (DPF), требующих спецификации BMW Longlife-04 или MB-Approval 229.51.',5,1,5,700000,'Oil6.jpg','ACEA A3/B3, A3/B4, C3;\nVW 504 00/ 507 00; \nVW 503 01;\nMB-Approval 229.51.',4,'5W-30',35),(19,'Total Quartz 7000 10W-40 5Л','Полусинтетическое моторное масло, производимое по улучшенной\nрецептуре 2008 года. Современное базовое масло совместно со специальными присадками\nпридают маслу улучшенные эксплуатационные характеристики.',5,5,4.7,399000,'Oil7.jpg','API SJ/CF ACEA A3-96/B3-96',5,'10W-40',31),(20,'GM OPEL 10W-40 5л','',5,5,4.7,325000,'Oil8.jpg','ACEA A3/B3/B4',5,'10W-40',32),(21,'Elf Evolution 900 SXR 5W-40 5л','Моторное масло, изготовленное по синтетической технологии для бензиновых и дизельных двигателей. Высокая технологичность производства данного масла позволяет получить от двигателя оптимальные эксплуатационные характеристики и способствует увеличению срока службы двигателя. Масло разработано специально для двигателей Renault.',5,1,5,560000,'Oil9.jpg','ACEA A3/B4;\nAPI SN/CF;\nRenault RN0700;\nRenault RN0710.',5,'5W-40',31),(22,'Shell Helix Ultra 5W-40 4л','100% Синтетическое масло экстра-класса c максимальным уровнем моющих характеристик для самых современных бензиновых и дизельных двигателей, в т.ч. с каталитическими нейтрализаторами и сажевыми фильтрами. Единственное масло, рекомендованное Ferrari.',5,1,3.6,630000,'Oil10.jpg','API SM/CF;\nACEA A3/B3/B4; \nMB 229.5;\nVW 502.00/505.00/503.01;\nBMW Longlife-01;\nFerrari;\nPorsche A40;\nRenault RN0710,RN0710;\nFIAT 9.55535.Z2.',4,'5W-40',36),(23,'Name2','Описание2',2,5,0,100,'Oil10.jpg','',2,'10E-1000',26),(24,'Nme4','sadasd4',1,5,3,14,'Oil4.jpg','asdasdasd',2,'qqqq',25),(25,'name5','555-----',3,3,0,55,'Oil6.jpg','ddddddddddddd',6,'121212',26),(26,'Name6','adfasf',2,5,0,111,'Oil4.jpg','sdfsdf',3,'121212',24),(27,'Name61','ssss',2,5,0,122,'Oil2.jpg','ssssss',2,'121212',26);
